// main.js
import { createApp } from 'vue';
import App from './App.vue';
import LoginForm from "./components/logiForm.vue"; // Assuming this is your login component
import Dashboard from "./components/dashBoard.vue"; // Assuming this is your dashboard component
import HowAreYou from "./components/profileForm.vue"; // New component

import { createRouter, createWebHistory } from 'vue-router';

const routes = [
  {
    path: '/',
    component: LoginForm,
    name: 'login',
  },
  {
    path: '/dashboard',
    component: Dashboard,
    name: 'dashboard',
  },
  {
    path: '/how-are-you',
    component: HowAreYou,
    name: 'how-are-you',
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

const app = createApp(App);
app.use(router);
app.component('LoginForm', LoginForm);
app.component('DashboardForm', Dashboard);
app.component('HowAreYou', HowAreYou); // Registering the new component
app.mount('#app');
